INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (165,'009','한밭중에 호랑이를 만났으니 나아감과 물러감이 모두 어렵습니다. 일을 하고자 해도 문제가 많으니 한 달은 심려만 하게 될 것입니다. 새로운 일을 찾아 나서거나 무리하는 것은 모두 불리합니다. 사람마다 나를 돕지 않고 오히려 해하려 하니 마음이 불안하고 불편합니다. 처음은 비록 고단하고 어렵지만 나중에 좋은 운이 기다리고 있으니 염려할 것은 없습니다. 어려운 일이 있거든 지혜로운 어른께 의논해 보십시오. 문제가 풀릴 것입니다. 하반기에는 길한 운이 문에 들어오니 기쁜 일이 생기겠습니다. 봄철에 기회가 있으니 그때를 놓쳐서는 안 됩니다. 올해는 인내가 필요한 해이니 조급함을 버리고 때를 기다리십시오. 동쪽과 서쪽 방향이 비교적 무난하고, 과로를 피하며 간과 신장 건강에 특히 유의해야 합니다. 시련 속에서도 희망을 잃지 마시고 꾸준히 노력하면 반드시 좋은 결과를 얻을 것입니다.','욕심을 부리다가 다시 어려움에 처하게 됩니다. 이를 버리고 노력해도 뜻대로 되기 어렵습니다. 그러나 귀인이 문에 나타나니 기쁜 일이 생길 것입니다. 봄철에 기회가 있으니 이 기회를 놓치면 안 됩니다. 어렵더라도 굳세게 도전하십시오. 북쪽 방향이 길하고, 호흡기 건강에 유의하십시오.','봄동산에 마침내 봄이 돌아와 꽃이 만발하고 열매를 맺으니 이보다 더 좋은 일이 있겠습니까? 꽃이 곳곳에 있으니 가는 곳마다 봄바람이 불어 상쾌합니다. 다만 관재가 아니라면 잠병이 생겨 몸을 피곤하게 할 수 있으니 건강을 챙기십시오. 동쪽이 길하고, 눈과 두통에 유의하십시오.','다른 사람에게 갈 재물이 의외로 내게 돌아오니 이 무슨 기쁨입니까? 동남방에서 재물이 뜻밖에 들어오니 일을 벌이고 성사시키는 데서 비롯된 것입니다. 반드시 은밀히 처리할 일이 생기겠으니 이익이 그 가운데 있습니다. 남쪽 방향이 길하고, 소화기에 신경 쓰십시오.','낯선 사람을 함부로 가까이해서는 안 됩니다. 또한 잠병이 침범할 수 있으니 몸을 조심하십시오. 기쁜 중에도 조심해야 할 것이 있으니 관재를 조심하십시오. 분수를 지키고 편안하게 지낸다면 흉을 면하고 뜻밖의 성공을 거둘 수 있습니다. 서쪽 방향이 길하고, 심장과 혈압에 유의하십시오.','은밀히 진행하던 일이 마침내 성공하여 기쁨을 누리게 됩니다. 친척이 아니면 외척 간에 도모한 일일 것입니다. 길함이 몸에 임했으니 반드시 기쁜 일이 생깁니다. 그러나 마음 한구석에 걱정이 있으니 어찌하겠습니까? 안정하면 문제없습니다. 동북쪽이 길하고, 관절과 뼈에 신경 쓰십시오.','달이 구름에 가려지니 좋은 달빛을 다시 보기 어렵습니다. 남쪽은 불리하니 출행하지 마십시오. 너무 밀어붙이지 말고 여유를 가져야 합니다. 바라는 일을 왕성히 추진해도 큰 성과 없이 힘만 쓰게 됩니다. 마음의 여유가 필요합니다. 안정하면 문제없습니다. 북쪽 방향이 길하고, 신경계에 유의하십시오.','신수가 대길하니 흉험 중에서도 길함이 있습니다. 길이 남북으로 뻗어 있으니 분주하여 여가가 없습니다. 버린 일을 다시 성취하고 마무리하려 하는데 어찌 바쁘지 않겠습니까? 위세가 당당하니 주변이 경외하겠습니다. 남쪽과 북쪽이 길하고, 허리와 등에 신경 쓰십시오.','화가 복이 되니 마음의 근심이 사라집니다. 음양이 서로 화합하였는데 어찌 길함이 없겠습니까? 관재가 아니라면 불시에 자손의 경사가 있을 것입니다. 막힌 일이 도리어 이익이 되니 무엇을 주저하겠습니까? 적극적으로 진행하십시오. 동쪽이 길하고, 위장 건강에 유의하십시오.','두 호랑이가 서로 싸우니 어느 호랑이가 이기고 어느 호랑이가 지겠습니까? 시비를 벌이면 구설수만 늘어나겠습니다. 그렇지 않으면 관재를 만나 도리어 화를 입게 되니 시비를 멀리하십시오. 서북쪽이 무난하고, 간과 담에 신경 쓰십시오.','출행하면 불리하니 현재를 지키고 안정하십시오. 새것을 도모하려다 원래 가진 것을 잃을 수 있습니다. 만약 집에 우환이 있으면 미리 대비하십시오. 그러면 흉을 면하게 됩니다. 마침내 옛것을 버리고 새것을 찾으니 사람들이 우러러보며 따르게 됩니다. 동남쪽이 길하고, 피부와 알레르기에 유의하십시오.','사람을 잘못 사귀어 해가 있으니 부당한 이익을 취하려 하지 마십시오. 신수가 불길하니 잠병을 조심하고 건강에 유의해야 합니다. 이 달의 운수는 흉함이 많고 길함이 적습니다. 너무 취하려 하면 도리어 가진 것까지 잃을까 두렵습니다. 북동쪽이 무난하고, 신장과 방광에 신경 쓰십시오.','몸이 편안하고 근심이 없으니 몸과 집안이 태평하겠습니다. 구름이 흩어지고 달이 나오니 마침내 소망을 이루게 됩니다. 비록 직업을 바꾸는 것은 마음만 상하게 되니 과분하게 도전하지 말고 분수를 지킴이 옳습니다. 서쪽 방향이 길하고, 치아와 잇몸 건강에 유의하십시오.','2025-03-02 03:02:00.93373+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (307,'009','Meeting a tiger in an open field makes both advancing and retreating difficult. Even if you want to work, many problems arise, so a month will pass in worry alone. Seeking new ventures or overexerting yourself is all disadvantageous. People do not help me but rather try to harm me, making my heart anxious and uncomfortable. Though the beginning is tiring and difficult, good fortune awaits later, so there is no need to worry. If difficulties arise, consult with wise elders. Problems will be resolved. In the second half of the year, auspicious fortune enters your door, bringing joyful events. Spring holds opportunities that must not be missed. This year requires patience—abandon haste and wait for the right time. East and west directions are relatively safe. Avoid overwork and pay special attention to liver and kidney health. Do not lose hope amid trials; persistent effort will surely bring good results.','Greed leads back to difficulties. Even if you abandon it and try, things do not go as planned. However, a benefactor appears at your door, bringing joy. Spring holds opportunities that must not be missed. Even if difficult, challenge boldly. The north is auspicious; mind your respiratory health.','Spring finally returns to the spring garden with flowers in full bloom and fruit forming—what could be better? Flowers are everywhere, so refreshing spring breezes blow wherever you go. However, if not legal troubles, illness may make you tired, so take care of your health. The east is auspicious; mind your eyes and headaches.','Wealth meant for others unexpectedly comes to you—what joy is this? Wealth from the southeast unexpectedly enters through conducting and completing business. Secret matters will arise, with profit within them. The south is auspicious; mind your digestive system.','Do not carelessly approach strangers. Also, be careful of your health as illness may attack. Even amid joy, there are things to be careful of—watch out for legal troubles. If you maintain your station and live comfortably, you can avoid misfortune and achieve unexpected success. The west is auspicious; mind your heart and blood pressure.','Work conducted secretly finally succeeds, bringing joy. If not relatives, it will be matters planned with in-laws. Good fortune has come to you, so joyful events will occur. But what can be done about the worry in a corner of your heart? Stability brings no problems. The northeast is auspicious; mind your joints and bones.','The moon is hidden by clouds, making good moonlight hard to see. The south is unfavorable, so do not travel there. Do not push too hard; maintain composure. Even pushing desires vigorously yields little result, just wasted effort. Mental composure is needed. Stability brings no problems. The north is auspicious; mind your nervous system.','Your fortune is greatly auspicious—even amid danger, there is good fortune. Paths extend north and south, keeping you busy with no leisure. Trying to achieve and complete abandoned work—how can you not be busy? Your dignified presence commands respect from surroundings. South and north are auspicious; mind your waist and back.','Misfortune becomes blessing, and worries in the heart disappear. Yin and yang have harmonized—how can there not be good fortune? If not legal troubles, unexpected celebrations for offspring will occur. Blocked matters turn to profit—why hesitate? Proceed actively. The east is auspicious; mind your stomach health.','Two tigers fight each other—which will win and which will lose? Engaging in disputes only increases gossip. Otherwise, you will encounter legal troubles and suffer harm—stay away from disputes. The northwest is manageable; mind your liver and gallbladder.','Travel brings disadvantage, so protect what you have and stay stable. Seeking new things may cause you to lose what you originally had. If there are troubles at home, prepare in advance to avoid misfortune. Finally, abandoning the old and finding the new, people will look up to you and follow. The southeast is auspicious; mind your skin and allergies.','Wrong associations bring harm, so do not seek unfair profits. Fortune is unfavorable, so watch for illness and mind your health. This month''s fortune has much misfortune and little luck. Trying to gain too much may cause you to lose what you have. The northeast is manageable; mind your kidneys and bladder.','Body is comfortable and free of worry, bringing peace to body and home. Clouds scatter and the moon emerges, finally achieving your hopes. Though changing jobs will only hurt your heart, so do not challenge excessively—maintaining your station is right. The west is auspicious; mind your teeth and gum health.','2025-03-02 03:02:00.93373+00','e');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (449,'009','野原で虎に出会い、進むことも退くことも難しい状況です。仕事をしようとしても問題が多く、一ヶ月は心配ばかりすることになるでしょう。新しいことを探したり無理をすることはすべて不利です。人々は私を助けずにむしろ害しようとするので、心が不安で居心地が悪いです。最初は疲れて大変ですが、後に良い運が待っているので心配することはありません。困ったことがあれば賢い年長者に相談してください。問題は解決するでしょう。下半期には吉運が門に入り、喜ばしいことが起こります。春にはチャンスがあるので、その時を逃してはいけません。今年は忍耐が必要な年なので、焦りを捨てて時を待ってください。東と西の方角が比較的無難です。過労を避け、特に肝臓と腎臓の健康に注意してください。試練の中でも希望を失わず、着実に努力すれば必ず良い結果を得られます。','欲張ると再び困難に陥ります。それを捨てて努力しても思い通りになりにくいです。しかし貴人が門に現れ、喜ばしいことが起こります。春にはチャンスがあるので、この機会を逃してはいけません。困難でも力強く挑戦してください。北が吉です。呼吸器の健康に気を付けてください。','春の庭にようやく春が戻り、花が満開で実を結ぶ—これ以上良いことがあるでしょうか？花がそこかしこにあり、行く先々で春風が吹いて爽やかです。ただし、訴訟沙汰でなければ病気が体を疲れさせることがあるので、健康に気を付けてください。東が吉です。目と頭痛に気を付けてください。','他の人に行くはずだった財物が意外にも自分に戻ってくる—これはなんという喜びでしょう？東南方から思いがけず財物が入ってきて、仕事を起こし成功させたことに由来します。必ず密かに処理すべき事が生じ、その中に利益があります。南が吉です。消化器に気を付けてください。','見知らぬ人にむやみに近づいてはいけません。また、病気が襲う可能性があるので体に気を付けてください。喜びの中にも注意すべきことがあるので、訴訟沙汰に気を付けてください。分をわきまえて穏やかに過ごせば、凶を免れ思いがけない成功を収められます。西が吉です。心臓と血圧に気を付けてください。','密かに進めていたことがついに成功し、喜びを味わうことになります。親戚でなければ姻戚間で図った事でしょう。吉運が体に臨んだので必ず喜ばしいことが起こります。しかし心の片隅に心配があるのでどうしましょう？安定すれば問題ありません。北東が吉です。関節と骨に気を付けてください。','月が雲に隠れ、良い月光を再び見ることが難しいです。南は不利なので旅行しないでください。無理に押し進めず、余裕を持ってください。望みを盛んに推進しても大きな成果なく力だけを消費します。心の余裕が必要です。安定すれば問題ありません。北が吉です。神経系に気を付けてください。','運勢が大吉で、危険の中にも吉があります。道が南北に伸びており、忙しくて余暇がありません。捨てた仕事を再び成し遂げ仕上げようとしているのに、忙しくないはずがありません。威勢が堂々としているので周囲が敬服します。南と北が吉です。腰と背中に気を付けてください。','禍が福となり、心の悩みが消えます。陰陽が互いに調和したのに、どうして吉がないでしょうか？訴訟沙汰でなければ、不意に子孫の慶事があるでしょう。塞がっていたことがかえって利益になるので、何をためらうことがあるでしょう？積極的に進めてください。東が吉です。胃の健康に気を付けてください。','二頭の虎が互いに戦えば、どの虎が勝ち、どの虎が負けるでしょう？是非を争えば口舌の災いだけが増えます。そうでなければ訴訟沙汰に遭い却って災いを被るので、是非を遠ざけてください。北西が無難です。肝臓と胆嚢に気を付けてください。','旅行は不利なので、現状を守り安定してください。新しいことを求めて元々持っていたものを失う可能性があります。家に憂いがあれば前もって備えてください。そうすれば凶を免れます。ついに古いものを捨て新しいものを見つけ、人々が仰ぎ見て従うようになります。東南が吉です。肌とアレルギーに気を付けてください。','人を間違って付き合って害があるので、不当な利益を取ろうとしないでください。運勢が不吉なので病気に注意し、健康に気を付けなければなりません。今月の運勢は凶が多く吉が少ないです。得ようとしすぎると却って持っているものまで失うかもしれません。北東が無難です。腎臓と膀胱に気を付けてください。','体が楽で心配がないので、体も家庭も太平でしょう。雲が散り月が出て、ついに望みを叶えることになります。転職は心を傷つけるだけなので、分不相応に挑戦せず分をわきまえることが正しいです。西が吉です。歯と歯茎の健康に気を付けてください。','2025-03-02 03:02:00.93373+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (378,'009','在旷野中遇到老虎，进退两难。即使想工作，问题也很多，一个月只会在担忧中度过。寻找新事物或过度努力都是不利的。人们不帮助我，反而试图伤害我，让我心神不宁，坐立不安。虽然开始时疲惫艰难，但好运在后面等着，所以不必担心。如有困难，请向有智慧的长辈咨询。问题会得到解决。下半年，吉运进门，会有喜事发生。春天有机会，千万不要错过。今年需要耐心——抛开急躁，等待时机。东方和西方方向相对安全。避免过度劳累，特别注意肝脏和肾脏健康。在磨难中不要失去希望，坚持努力必定会有好结果。','贪婪会再次陷入困难。即使放弃贪念努力，事情也不如意。但贵人出现在门前，会有喜事。春天有机会，绝不能错过。即使困难，也要勇敢挑战。北方吉利，注意呼吸系统健康。','春天终于回到春园，花朵盛开结出果实——还有什么比这更好的呢？到处都是花，无论去哪里都有清爽的春风吹拂。但如果不是官司，疾病可能会让你疲惫，所以要注意健康。东方吉利，注意眼睛和头痛。','本该给别人的财富意外地来到自己身边——这是多大的喜悦啊？东南方的财富意外地进来，源于开展和完成事业。必定会有需要秘密处理的事情，利润就在其中。南方吉利，注意消化系统。','不要轻易接近陌生人。另外，要小心身体，因为疾病可能侵袭。喜悦中也有需要小心的事情——当心官司。如果守住本分，安稳度日，就能避免不幸，取得意外的成功。西方吉利，注意心脏和血压。','秘密进行的事情终于成功，将享受喜悦。如果不是亲戚，那就是与姻亲合谋的事。好运降临，必有喜事发生。但心中一角有担忧，该怎么办呢？稳定下来就没问题。东北方吉利，注意关节和骨骼。','月亮被云遮住，难以再见美好的月光。南方不利，不要出行。不要太过强求，要保持从容。即使大力推动愿望，也只是白费力气，没有大成效。需要心理上的从容。稳定下来就没问题。北方吉利，注意神经系统。','运势大吉，危险中也有吉祥。道路南北延伸，忙碌得没有闲暇。想要完成和收尾放弃的工作，怎能不忙？威势堂堂，周围都会敬服。南方和北方吉利，注意腰部和背部。','祸变为福，心中忧愁消失。阴阳相互调和，怎会没有好运？如果不是官司，会有子孙的意外喜事。阻塞之事反而变为利益，还犹豫什么？积极推进吧。东方吉利，注意胃部健康。','两虎相斗，哪只虎赢哪只虎输？争论是非只会增加口舌之争。否则会遇到官司反受其害，远离是非吧。西北方尚可，注意肝胆。','出行不利，守住现有的保持稳定。追求新事物可能会失去原有的。如果家中有忧患，要提前防备。这样就能避免不幸。最终抛弃旧的找到新的，人们会仰望追随你。东南方吉利，注意皮肤和过敏。','交友不当会有害，不要谋取不正当的利益。运势不吉，要小心疾病，注意健康。这个月运势凶多吉少。如果太贪心，恐怕会连已有的都失去。东北方尚可，注意肾脏和膀胱。','身体舒适无忧，身心家庭都平安。云散月出，终于实现愿望。虽然换工作只会伤心，不要过分挑战，守住本分才是正确的。西方吉利，注意牙齿和牙龈健康。','2025-03-02 03:02:00.93373+00','c');
